package com.example.root.movieretrofitmvp.data;import android.os.Parcel;import android.os.Parcelable;import com.google.gson.annotations.SerializedName;import java.util.List;public class MovieResponse implements Parcelable{    @SerializedName("results")    private List<MovieModel> results;    private MovieResponse(Parcel in) {        results = in.createTypedArrayList(MovieModel.CREATOR);    }    public static final Parcelable.Creator<MovieResponse> CREATOR = new Parcelable.Creator<MovieResponse>() {        @Override        public MovieResponse createFromParcel(Parcel in) {            return new MovieResponse(in);        }        @Override        public MovieResponse[] newArray(int size) {            return new MovieResponse[size];        }    };    public List<MovieModel> getResults() {        return results;    }    public void setResults(List<MovieModel> results) {        this.results = results;    }    @Override    public int describeContents() {        return 0;    }    @Override    public void writeToParcel(Parcel dest, int flags) {        dest.writeTypedList(results);    }}